  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0089635 includes physical,
  profile and underway data collected aboard the ROGER REVELLE during cruise RR1005
  in the Philippine Sea and South China Sea (Nan Hai) from 2010-04-06 to 2010-04-28.
  These data include CONDUCTIVITY, CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT
  SPEED - NORTH/SOUTH COMPONENT (V), SALINITY and WATER TEMPERATURE. The instruments
  used to collect these data include ADCP, CTD and GPS. These data were collected
  by Peter Worcester of University of California - San Diego; Scripps Institution
  of Oceanography as part of North Pacific Acoustic Laboratory (NPAL) Moorings. The
  Lamont-Doherty Earth Observatory (LDEO) submitted these data to NODC as part of
  the NSF sponsored Rolling Deck to Repository (R2R) program.The ADCP data represent
  the raw and automated processed data set. Post processed quality assessed data are
  not available in this accession.\",\n\t\"owner_org\": \"9cda5205-d632-4814-96e7-a4ab5e0dce85\",\n\t\"extras\":
